import {fetchProducts} from '../api/api'

const HomeScreen = () => {
    const [products, setProducts] = useState([]);
    const data = fetchProducts().then(data => data.json)
    useEffect(() => {
        fetchProducts
          .then(results => results.json())
          .then(data => setProducts());
      }, []);
    return(
        <div>
            HomeScreen
        </div>
    )
}

export default HomeScreen;
